import React from 'react';
import { styles } from '../dialogWindows/css/dialog_css';

export const renderTaskStatusBubble = (taskStatusData) => {
    const classes = styles();
    return (
        <span className={classes.taskStatus} style={{backgroundColor: taskStatusData.color}}>
            {taskStatusData.title}
        </span>
    )
}

export const menuProps = {
    anchorOrigin: {
    vertical: "bottom",
        horizontal: "left"
    },
    transformOrigin: {
    vertical: "top",
        horizontal: "left"
    },
    getContentAnchorEl: null
};
